import React from 'react';
import {Drawer} from "antd";

const DrawerBuy = ({open, onClose}) => {
    return (
        <Drawer
            title="Выбрать билет"
            placement="bottom"
            closable={false}
            onClose={onClose}
            open={open}

        >
            <p>Some contents...</p>
            <p>Some contents...</p>
            <p>Some contents...</p>
        </Drawer>
    );
};

export default DrawerBuy;
